  [],\n\t\"revision_timestamp\": \"2015-07-08T19:23:09.797637\",\n\t\"name\": \"uars-high-resolution-doppler-imager-hrdi-level-3al-v001\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The High Resolution Doppler Imager (HRDI)
  Level 3AL data product consists of daily, 4 degree increment latitude-ordered vertical
  profiles of meridional and zonal wind components, temperature and volume emmission
  rate of O2. The instrument measured Doppler shifts of spectral lines in the visible
  and near-IR between 400 and 800 nm.  HRDI was flown on NASA's Upper Atmosphere Research
  Satellite (UARS) and designed to measure winds and other parameters in the mesosphere
  and lower thermosphere by primarily observing the Doppler shift of emitted light,
  and in the stratosphere by observing the Doppler shift of atmospheric absorption
  features. Measurements were made in the mesosphere between 50 and 115 km, and in
  the stratosphere between 10 and 40 km at about 2.5 km resolution. Data were collected
  between latitude 40S and 76N and 76S and 40N, alternating each satellite yaw cycle
  of about 36 days. The HRDI Level 3AL data were processed with the version 11 algorithm.nnThe
  HRDI level 3AL product consists of 8 granules per day. A data granule is one HRDI
  species or subtype per day.  The following subtypes are availablenn 1) MERWIN_A
  - meridional wind component on altitude grid  [m/s]n 2) MERWIN_P - meridional wind
  component on pressure grid  [m/s]n 3) ZONWIN_A - zonal wind component on altitude
  grid       [m/s]n 4) ZONWIN_P - zonal wind component on pressure grid       [m/s]n
  5) TEMP_A - temperature on altitude grid                  [Kelvin]n 6) TEMP_P -
  temperature on pressure grid                  [Kelvin]n 7) VOLER_A - O2 volume emission
  rate on altitude grid     [cm-3]n 8) VOLER_P - O2 volume emission rate on pressre
  grid      [cm-3]nnHRDI data are on the UARS standard altitude levels (in km) given
  by:nnz(i) = 5*i                 for i<=12nz(i) = 60 + (i-12)*3       for 13 <= i
  <= 32nz(i) = 120 + (i-32)*5      for 33 <= i <= 88nnas well as the UARS standard
  pressure levels (in mbars) given by:nnP(i) =  1000 * 10**(-i/6)  for i = 0, 1, 2,
  ...nnThe data files are available in a binary record oriented format.\",\n\t\"license_title\":
